import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import NavBar from './components/nav.js'

function AuthorizedContent (props) {
  return <div>
    <NavBar />

    <p>Some authorized Content</p>
  </div>
}

function App(props) {

  let content = props.loggedIn? <AuthorizedContent /> : < NormalContent />

  return (
    <div className="App">
    </div>
  );
}

export default App;
